head.script:
scwin.onpageload = function() {
	function searchListExpand(){
        const btnExp = $('.btn-expand');

        btnExp.on('click', function(){
            const searchBox = $(this).closest('.search-box');
            const currentVal = $(this).val();

            if(searchBox.hasClass('expand')){
                searchBox.removeClass('expand');
            } else {
                searchBox.addClass('expand');
            }
            if(currentVal === "열기"){
                $(this).val("닫기");
            } else {
                $(this).val("열기");
            }
        });
    };
    searchListExpand();
};
